import { Component } from "@angular/core";
import { CommonModule } from "@angular/common";

interface DividendItem {
  id: string;
  symbol: string;
  companyName: string;
  market: string;
  dividend: number;
  exDate?: string;
  recordDate?: string;
  paymentDate?: string;
  color: string;
  letter: string;
}

interface EarningsItem {
  id: string;
  symbol: string;
  companyName: string;
  market: string;
  date: string;
  marketTiming: string; // Post Market, Pre-Market, etc.
  epsActual?: number;
  epsForecast?: number;
  revenueActual?: number;
  revenueForecast?: string;
  logoUrl?: string;
  hasWatchlist: boolean;
}

interface EconomyItem {
  id: string;
  title: string;
  period: string; // Sep YoY, Sep MoM, etc.
  actual?: string;
  consensus?: string;
  previous: string;
  date: string;
  time: string;
  importance: number; // 1-3 stars
  country: string; // SI for Singapore
  category: string;
}

interface EarningsDay {
  date: string;
  displayDate: string;
  dividends: DividendItem[];
}

@Component({
  selector: "app-earnings",
  standalone: true,
  imports: [CommonModule],
  templateUrl: "./earnings.component.html",
  styleUrls: ["./earnings.component.scss"],
})
export class EarningsCalendarComponent {
  selectedDate = "10 / 22";
  selectedYear = "2025";
  selectedPeriod = "Day";
  activeEarningsTab = "Economy";
  activeFilterTab = "Economy";

  earningsData: DividendItem[] = [
    {
      id: "1",
