      companyName: "SGX",
      market: "SG",
      dividend: 0.105,
      paymentDate: "2025-10-27",
      color: "#1976d2",
      letter: "S",
    },
    {
      id: "4",
      symbol: "HSHD.SI",
      companyName: "HSBC HK SDR 5to1",
      market: "SG",
      dividend: 0.0198,
      paymentDate: "2025-10-01",
      color: "#ff9800",
      letter: "H",
    },
    {
      id: "5",
      symbol: "W05.SI",
      companyName: "Wing Tai",
      market: "SG",
      dividend: 0.04,
